const Card = ({ dentist, favs }) => {
  // Your code here
};
function Favs() {

  const favs = localStorage.getItem('favs');
  let parsedFavs = JSON.parse(favs) || [];

  return (
    <>
      <h1>Dentists Favs</h1>
      <div className="card-grid">
        {parsedFavs.map(dentistFav => (
          <div>
            <h3>{dentistFav.name}</h3>
          </div>
        ))}
      </div>
    </>
  );
}

export default Favs;
